import './App.css';
import { FaPlus, FaTrash, FaEdit } from 'react-icons/fa'; 

function App() {
  return (
    <div className="App">
      <div className="reverse-button">
        <button>REVERSE</button>
      </div>

      <div className="cart-container">
        <div className="cart">
          QUITE
        </div>
      </div>

      <div className="menu">
        <button><FaTrash size={30}/></button>
        <button><FaEdit /></button>
        <button><FaPlus /></button>

      </div>

    </div>
  );
}

export default App;
